"original": |2-
     This REQUIRED attribute indicates the time at which the Job entered a
     Terminating State ('completed', 'canceled', or 'aborted').  The
     out-of-band 'no-value' value is returned if the Job has not yet
     completed, been canceled, or aborted (see the beginning of
     Section 5.1).
"fixed": |-
  This REQUIRED attribute indicates the time at which the Job entered a Terminating State ('completed', 'canceled', or 'aborted').  The out-of-band 'no-value' value is returned if the Job has not yet completed, been canceled, or aborted (see the beginning of Section 5.1).
"ko": |-
  이 필수 속성은 작업이 종료 상태('완료', '취소' 또는 '중단')에 들어간 시간을 나타냅니다. 작업이 아직 완료되지 않았거나 취소되었거나 중단된 경우 대역 외 '값 없음' 값이 반환됩니다(섹션 5.1의 시작 부분 참조).
